def productExceptSelf(nums, m):
    left = 1
    ans = [1]
    for i in range(len(nums) - 1):
        left *= nums[i]
        ans.append(left)

    right = 1
    for j in range(len(nums) - 1, -1, -1):
        ans[j] *= right
        right *= nums[j]

    _sum = 0
    for i in range(len(ans)):
        ans[i] = ans[i] % m
        _sum += ans[i]
        _sum %= m

    return _sum % m


